import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Login from './screens/Login';
import Admin from './screens/Admin';
import Vendeur from './screens/Vendeur';
import Contact from './screens/Contact.jsx';
import Erreur from './screens/Erreur';
import Produit from './screens/Produit';
import Produits from './screens/Produits';

function App() {
  return (
    <div>
      <p>Découvrez nos différentes recettes</p>
      <Routes>
      <Route path='/' element={Login} />
      <Route exact path='/produits' element={Produits} />
      <Route exact path='/produit' element={Produit} />
      <Route exact path='/contact' element={Contact} />
      <Route exact path='/vendeur' element={Vendeur} />
      <Route exact path='/admin' element={Admin} />
      <Route path='*' element={Erreur} />
    </Routes>
    </div>

  );
}

export default App;
